import React from "react";

import {
  Container,
  Button,
  ButtonGroup,
  Center,
  Square,
  Circle,
  Box,
} from "@chakra-ui/react";

const Landing = () => {
  return (
    <div>
      <box>
        {" "}
        <Button colorScheme="blue">Login/Signup</Button>
      </box>

      <center>
        <header> Fantastic Happiness!</header>
      </center>

      <Box> Dev Profile</Box>
    </div>
  );
};

export default Landing;
